	add("corkscrew", "{\"term\":\"corkscrew\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|cork|screw|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An implement for opening bottles that are sealed by a cork. Sometimes specifically such an implement that includes a screw-shaped part, or worm\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I opened the wine with a \u0027\u0027corkscrew\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This hand a \u0027\u0027\u0027Cork-scrue\u0027\u0027\u0027 did contain, And that a Bottle of \u0027Champaign\u0027. }}\u0026lt;!-- first known use --\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The screw-shaped worm of a typical corkscrew\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A type of sharp, twisting punch, often one thrown close and from the side\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"the immovable McCoy let fly his most miraculous punch of the evening, of his lives, a world-beater of a right \u0027\u0027corkscrew\u0027\u0027, a punch years in the windup\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A type of inversion used in roller coasters\", \"priority\":7}]}, \"synonyms\":{}}");

	add("cormophyte", "{\"term\":\"cormophyte\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Ancient greek (to 1453) {{m|grc|κορμός||trunk stripped of its boughs}} {{suffix||phyte|t1\u003dplant|lang\u003den}}; see also {{m|en|corm||swollen underground stem}}, Latin {{m|la|cormus}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any plant having a proper stem or axis of growth, which is distinct from its leaves, phyllophyt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1940\u0027\u0027, Edgar Nelson Transeau, Homer Cleveland Sampson, Lewis Hanford Tiffany, \u0027Textbook of botany\u0027, Part 1, [http://books.google.com.au/books?id\u003dU287qVzTszoC\u0026amp;q\u003d%22cormophyte%22%7C%22cormophytes%22\u0026amp;dq\u003d%22cormophyte%22%7C%22cormophytes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d35_5UtHWJoqIkwWoyYGQBQ\u0026amp;redir_esc\u003dy page 156\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Very careful developmental or anatomical investigation may be required to show that the variously-constructed organs of many \u0027\u0027cormophytes\u0027\u0027 are derived by the metamorphosis of the three primary organs, root, stem, and leaf, and to ascertain with which of these any particular structure is really homologous\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, E. J. H. Corner, \u0027The Life of Plants\u0027, [http://books.google.com.au/books?id\u003dV0VyqECPiuoC\u0026amp;pg\u003dPA108\u0026amp;dq\u003d%22cormophyte%22%7C%22cormophytes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d35_5UtHWJoqIkwWoyYGQBQ\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cormophyte%22%7C%22cormophytes%22\u0026amp;f\u003dfalse page 108\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Botany used to recognize, if vaguely, these two kinds of plant, namely the thallophyte which grew and absorbed superficially, and the \u0027\u0027cormophyte\u0027\u0027, which is the root-shoot system with internal accommodation\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Giulia Caneva, Maria Pia Nugari, M. P. Nugari, O. Salvadori (editors), \u0027Plant Biology for Cultural Heritage: Biodeterioration and Conservation\u0027, [http://books.google.com.au/books?id\u003d59I2wSASWx0C\u0026amp;pg\u003dPA95\u0026amp;dq\u003d%22cormophyte%22%7C%22cormophytes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d35_5UtHWJoqIkwWoyYGQBQ\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cormophyte%22%7C%22cormophytes%22\u0026amp;f\u003dfalse page 91\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The morphology of \u0027\u0027cormophytes\u0027\u0027 exhibits considerable variations in size, appearance of the various parts, and duration of the life cycle\", \"priority\":9}]}, \"synonyms\":{}}");

	add("cormorant", "{\"term\":\"cormorant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|cormaran}} (modern {{m|fr|cormoran}}), from {{m|la|corvus marīnus|lit\u003dsea-raven}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various medium-large black seabirds of the family Phalacrocoracidae, especially the great cormorant, \u0027Phalacrocorax carbo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A voracious eater; a glutton\", \"priority\":2}]}, \"synonyms\":{}}");

	add("cornball", "{\"term\":\"cornball\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|corn|ball|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unsophisticated person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something excessively corny\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That movie was a real \u0027\u0027cornball\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"26 June 2014\u0027\u0027, A.A Dowd, AV Club \u0027Paul Rudd and Amy Poehler spoof rom-com clichés in They Came Together\u0027[http://www.avclub.com/review/paul-rudd-and-amy-poehler-spoof-rom-com-cliches-th-206220\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Rudd, especially, finds the perfect balance between synthetic \u0027\u0027cornball\u0027\u0027 charm and actual emotional engagement. Like the movie itself, he’s best when playing the rom-com clichés straight\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A ball of popped corn stuck together with soft candy from molasses or sugar\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1871\u0027\u0027, \u0027The Myrtle\u0027 (volume 21, page 301\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"How large and inviting were the \u0027\u0027cornballs\u0027\u0027 that piled the platter, and how crisp and glossy the braids and twists of molasses candy that mother and cousin had made when the little ones were snug in bed\", \"priority\":8}]}, \"synonyms\":{}}");

	add("corncob", "{\"term\":\"corncob\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|corn|cob|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The central cylindrical core of an ear of corn (maize) on which the kernels are attached in rows\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1858\u0027\u0027, w:Oliver Wendell Holmes, Oliver Wendell Holmes, \u0027s:The Autocrat of the The Autocrat of the Breakfast-Table\u0027, \u0027The “Breakfast-Table” Series\u0027, George Routledge and Sons (1882), page [http://books.google.com/books?id\u003dXjYCAAAAQAAJ\u0026amp;q\u003dcorncob 23\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"London is like a shelled \u0027\u0027corncob\u0027\u0027 on the Derby day, and there is not a clerk who could raise the money to hire a saddle with an old hack under it that can sit down on his office-stool the next day without wincing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, ed. w:Henry Haven Henry Haven Windsor, \u0026quot;Corncob Seen as Source of New Industry\u0026quot;, \u0027Popular Mechanics\u0027, volume XXXVIII, page [http://books.google.com/books?id\u003dlDZLAAAAMAAJ\u0026amp;q\u003dcorncob 765\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Six years of persistent research at the Bureau of Chemistry of the Department of Agriculture, has resulted in establishing the fact that a number of interesting and useful by-products can be derived from the humble \u0027\u0027corncob\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, w:Chika Chika Unigwe, \u0027On Black Sisters Street\u0027, Random House, ISBN 978-1-4000-6833-3, page 32\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He bit into a \u0027\u0027corncob\u0027\u0027, and Chisom watched him munch with his mouth open, his jaws working the corn like a mini grinding machine\", \"priority\":7}]}, \"synonyms\":{}}");

	add("corncockle", "{\"term\":\"corncockle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|corn|cockle|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several species of flowering plants, of the genus \u0027Agrostemma\u0027, in the Caryophyllaceae family\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cornea", "{\"term\":\"cornea\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027cornea tela\u0027 (horny tissue) from \u0027cornu\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The transparent layer making up the outermost front part of the eye, covering the iris, pupil, and anterior chamber\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cornel", "{\"term\":\"cornel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027cornus\u0027 (the european cornel)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Cornus mas right|thumb|\u0027\u0027European cornel fruits\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any tree or shrub of the dogwood subgenera, or , especially \u0027Cornus mas\u0027, the European cornel\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The cherry-like fruit of such plants, certain of which are edible\", \"priority\":3}]}, \"synonyms\":{}}");

	add("corner", "{\"term\":\"corner\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) {{m|enm|corner}}, from Anglo-norman {{m|fro|cornere}} (compare Old french (842-ca. 1400) {{m|fro|cornier}}, {{m|fro|corniere||corner}}), from Old french (842-ca. 1400) {{m|fro|corne||corner, angle|lit\u003da horn, projecting point}}, from *{{m|la||corna|horn}}, from Latin {{m|la|cornua}}, plural of {{m|la|cornū||projecting point, end, horn}}. More at {{l|en|hirn}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The point where two converging lines meet; an angle, either external or internal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The space in the angle between converging lines or walls which meet in a point\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They burned the old gun that used to stand in the dark \u0027\u0027corner\u0027\u0027 up in the garret, close to the stuffed fox that always grinned so fiercely. Perhaps the reason why he seemed in such a ghastly rage was that he did not come by his death fairly. Otherwise his pelt would not have been so perfect. And why else was he put away up there out of sight?—and so magnificent a brush as he had too\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The projection into space of an angle in a solid object\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An intersection of two streets; any of the four outer points off the street at that intersection\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An edge or extremity; the part farthest from the center; hence, any quarter or part, or the direction in which it lies\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"s:The Merchant of The Merchant of Venice\u0027, Act 2\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Why, that’s the lady: all the world desires her; / From the four \u0027\u0027corners\u0027\u0027 of the earth they come, / To kiss this shrine, this mortal-breathing saint\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A secret or secluded place; a remote or out of the way place; a nook\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A sufficient interest in a salable security or commodity to allow the cornering party to influence prices\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Relating to the playing field\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"One of the four vertices of the strike zone\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"first First base or third base\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A corner kick\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A cornerback\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A place where people meet for a particular purpose\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Welcome to our English \u0027\u0027corner\", \"priority\":17}]}, \"synonyms\":{}}");

	add("cornetcy", "{\"term\":\"cornetcy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Formed as {{suffix|cornet|cy|gloss1\u003dthe fifth commissioned officer in a troop of cavalry|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The rank, rôle, or position of a cornet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1761\u0027\u0027, \u0027A New and General Biographical Dictionary\u0027, volume 12, page 477, “Jod\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His uncle…diverted him from that pursuit, and gave him a cornetcy in his own regiment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1809\u0027\u0027, w:Arthur Wellesley, 1st Duke of Arthur Wellesley, 1st Duke of Wellington [aut.], w:John Lieutenant-Colonel John Gurwood [compil.], \u0027Wellington Despatches\u0027, volume 5, page 14\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I shall recommend your friend for an Ensigncy. Should you prefer a Cornetcy for him, I may be able to give him one\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1885\u0027\u0027 May 9th, \u0027w:Manchester Evening Manchester Evening News\u0027, page 3, column\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He was afterwards gazetted to a Cornetcy in the First Regiment of Life Guards\", \"priority\":7}]}, \"synonyms\":{}}");

	add("corneter", "{\"term\":\"corneter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|cornet|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who plays a cornet\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cornetist", "{\"term\":\"cornetist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|cornet|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who plays the cornet\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cornetto", "{\"term\":\"cornetto\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|Italian in origin?|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A trumpet-like wind instrument used in European music of the medieval, Renaissance, and Baroque periods\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cornfield", "{\"term\":\"cornfield\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|corn|field|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A field of corn, wheat or other cereal cro\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, \u0027The Wonderful Wizard of Oz\u0027 Chapter 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Your Silver Shoes will carry you over the desert,\u0026quot; replied Glinda. \u0026quot;If you had known their power you could have gone back to your Aunt Em the very first day you came to this country.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;But then I should not have had my wonderful brains!\u0026quot; cried the Scarecrow. \u0026quot;I might have passed my whole life in the farmer\u0027s \u0027\u0027cornfield\u0027\u0027.\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

	add("cornflake", "{\"term\":\"cornflake\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|corn|flake|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A toasted flake of maize used as breakfast cereal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"fr:cornflakeml:cornflake\", \"priority\":2}]}, \"synonyms\":{}}");

	add("cornhole", "{\"term\":\"cornhole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small room connected to a threshing floor\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, J E C Peters, \u0027The Development of Farm Buildings in Western Lowland Staffordshire up to 1880\u0027, [http://books.google.com/books?id\u003d_A8NAQAAIAAJ\u0026amp;pg\u003dPA97\u0026amp;dq\u003dcornhole page 97\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027cornhole\u0027\u0027 was a small, brick room opening off the threshing floor, about six or seven feet high, […] variously known as the \u0027\u0027cornhole\u0027\u0027 or cornbin, and was designed for flail threshing, holding the grain until it was winnowed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1981\u0027\u0027, J E C Peters, \u0027Discovering Traditional Farm Buildings\u0027, [http://books.google.com/books?id\u003ddLH_LEQkjKEC\u0026amp;pg\u003dPA17\u0026amp;dq\u003dcornhole page 17 \u0026lt;small\u0026gt;with illustration\u0026lt;/small\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A small room may be found opening off the threshing floor on one side […] This is the \u0027\u0027cornhole\u0027\u0027, a mid-eighteenth-century development so far known only in Staffordshire and Suffolk, with a few in east Sussex\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A game similar to beanbag toss, popular in Ohio, in which a bag is filled with corn feed and thrown into a hole. See Cornhole\u0027\u0027 in Wikipedia\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, “Cornhole Game”,\u0027Cincinnati Magazine\u0027, October 2002, [http://books.google.com/books?id\u003dUusCAAAAMBAJ\u0026amp;pg\u003dPA114\u0026amp;dq\u003dcornhole page 114\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Cornhole\u0027\u0027, the indigenous pastime of Cincinnati\u0027s west side, is basically a democratized version of horseshoes\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, F. Winternitz, S. Bellman, \u0027Insiders\u0027 Guide to Cincinnati\u0027, [http://books.google.com/books?id\u003d4e7XLGfekD8C\u0026amp;pg\u003dPA230\u0026amp;dq\u003dcornhole page 230\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Cincinnatians, of course, know the true meaning of \u0027\u0027cornhole\u0027\u0027. The homegrown bag-toss game, which some suggest was even invented here, requires few tools: some beanbags, a box with a hole in it, and… well, that\u0027s it, really\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Anus. (From the old-fashioned practice of using dried corncobs instead of toilet paper in outdoor privies\", \"priority\":11}]}, \"synonyms\":{}}");

	add("cornhusking", "{\"term\":\"cornhusking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|cornhusk|ing|lang\u003den}} or {{compound|corn|husking|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The removal of the husk from corn\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Donald Winkler, \u0027The Women in Lincoln\u0027s Life\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He excelled at \u0027\u0027cornhuskings\u0027\u0027, where men and boys were divided into two groups, each striving to shuck the most corn\", \"priority\":3}]}, \"synonyms\":{}}");

	add("corniche", "{\"term\":\"corniche\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027corniche\u0027 (ledge) Image:BeirutCorniche.jpg|thumb|right|150px|Beirut \u0027\u0027corniche\u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A road built on a ledge (cliff), \u0027especially\u0027 along water (a river, sea, etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cornichon", "{\"term\":\"cornichon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pickled gherkin cucumbe\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cornin", "{\"term\":\"cornin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027Cornus\u0027 {{suffix||in|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bitter principle obtained from dogwood (\u0027Cornus florida\u0027), as a white crystalline substance; cornic acid\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An extract from dogwood used as a febrifuge\", \"priority\":2}]}, \"synonyms\":{}}");

	add("corniness", "{\"term\":\"corniness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being corny\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cornish", "{\"term\":\"cornish\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{affix|en|Cornwall|alt1\u003dCorn(wall)|-ish}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Celtic language of Cornwall, related to Welsh and Breton\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A town in Main\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A town in New Hampshir\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A town in Oklahom\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A town in Utah, at the border with Idaho\", \"priority\":5}]}, \"synonyms\":{}}");

	add("cornishman", "{\"term\":\"cornishman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|Cornish|man|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man from Cornwall\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cornishwoman", "{\"term\":\"cornishwoman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|Cornish|woman|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman from Cornwall\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cornpone", "{\"term\":\"cornpone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of cornbread made without milk or eggs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something or someone considered stereotypical of rural, Southern US attitudes or attributes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, John Baxter, \u0027We\u0027ll Always Have Paris\u0027, Bantam 2006, p. 27\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Her southern accent was rich as molasses, and she really did, without affectation, call everyone ‘y\u0027all’, but the \u0027\u0027cornpone\u0027\u0027 was camouflage\", \"priority\":4}]}, \"synonyms\":{}}");

	add("cornrow", "{\"term\":\"cornrow\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|corn|row|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hairstyle, of African origin, having rows of tightly braided hair close to the scalp\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cornstarch", "{\"term\":\"cornstarch\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|corn|starch|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very fine starch powder derived from corn (maize) used in cooking as a thickener, to keep things from sticking, or as an anti-caking agent\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cornucopia", "{\"term\":\"cornucopia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|Cornūcōpiae||mythical horn of plenty}}, from {{m|la|cornū||horn}} + {{m|la|cōpia||supply}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A goat\u0027s horn endlessly overflowing with fruit, flowers and grain; or full of whatever its owner wanted\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A hollow horn- or cone-shaped object, filled with edible or useful things\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An abundance or plentiful supply\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The store provided a veritable \u0027\u0027cornucopia\u0027\u0027 of modern gadgets\", \"priority\":4}]}, \"synonyms\":{}}");

	add("cornwall", "{\"term\":\"cornwall\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"Latin\"], \"text\":\"From Latin \u0027cornovii\u0027 (peninsula people) + Old english (ca. 450-1100) \u0027wealh\u0027 (stranger or foreigner)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A maritime county of England, forming its south-western extremity, bordered by Devon in the east\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the country \u0026lt;!-- def\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2; sources: http://www.celticleague.net/about-us/ http://www.eurominority.eu/version/eng/minority-detail.asp?id_minorities\u003d67 https://web.archive.org/web/20080921183934/http://www.gov.im/post/stamps/FutureIssue.aspx?categoryid\u003d164 --\u0026gt; of the Cornish, currently having the status of a royal duchy in England, consisting at least of the Cornwall County and the Isles of Scilly\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A town in Connecticu\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A town in New Yor\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A city in Ontari\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A borough in Pennsylvani\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A town in Prince Edward Islan\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A town in Vermont\", \"priority\":9}]}, \"synonyms\":{}}");

	add("cornwallite", "{\"term\":\"cornwallite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Cornwall|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A basic copper arsenate mineral with chemical formula Cu\u0026lt;sub\u0026gt;5\u0026lt;/sub\u0026gt;(AsO\u0026lt;sub\u0026gt;4\u0026lt;/sub\u0026gt;)\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;(OH)\u0026lt;sub\u0026gt;4\u0026lt;/sub\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("corollary", "{\"term\":\"corollary\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) from {{m|la|corōllārium||deduction, consequence, {{non-gloss definition|originally}} money paid for a garland, {{non-gloss definition|hence}} gift, gratuity, something extra}}, from {{m|la|corōlla||small garland}}, diminutive of {{m|la|corōna||crown}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something given beyond what is actually due; something added or superfluous\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something which occurs \u0027a fortiori\u0027, as a result of another effort without significant additional effort\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Finally getting that cracked window fixed was a nice \u0027\u0027corollary\u0027\u0027 of redoing the whole storefont\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A proposition which follows easily from the proof of another proposition\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"We have proven that this set is finite and well ordered; as a \u0027\u0027corollary\u0027\u0027, we now know that there is an order-preserving map from it to the natural numbers\", \"priority\":5}]}, \"synonyms\":{}}");

	add("coromandel", "{\"term\":\"coromandel\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"from the {{w|Coromandel Coast}} in India, a source of this material\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Calamander\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1917\u0027\u0027, \u0026quot;My Son\u0027s Wife\u0026quot;, in \u0027A Diversity of Creatures\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Rhoda took their battered hats, led the women upstairs for hairpins, and presently fed them all with tea-cakes, poached eggs, anchovy toast, and drinks from a \u0027\u0027coromandel\u0027\u0027-wood liqueur case\", \"priority\":3}]}, \"synonyms\":{}}");

