	add("coroner", "{\"term\":\"coroner\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027curuner\u0027 from \u0027custos placitorum coronae\u0027 (guardian of the crown\u0027s pleas) The function was originally to protect royal properties.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A public official who presides over an inquest into unnatural deaths\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A medical doctor who performs autopsies and determines time and cause of death from a scientific standpoint\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The administrative head of a sheading\", \"priority\":3}]}, \"synonyms\":{}}");

	add("coronides", "{\"term\":\"coronides\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1938\u0027\u0027: \u0027Journal of Theological Studies\u0027, volumes 39–40, [http://books.google.co.uk/books?ei\u003dZM08SsLAMY-6ygT4z8C6BQ\u0026amp;id\u003dfXYTAAAAIAAJ\u0026amp;dq\u003d%22coronides%22\u0026amp;q\u003d%22style+of+the+coronides%22\u0026amp;pgis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"search_anchor page 410] (Macmillan\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It has previously been noticed that D makes constant use of a filling-mark at the ends of lines, which is never used by A and very rarely by B, and that B is conspicuous for his extremely illiterate spelling; and to these the authors add a new criterion, that of the style of the \u0027\u0027\u0027coronides\u0027\u0027\u0027 at the ends of books, of which facsimiles are given.Category:English irregular plurals ending in \u0026quot;-des\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

