	add("corporation", "{\"term\":\"corporation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027corporatio\u0027 () from Latin \u0027corporare\u0027 past participle \u0027corporatus\u0027 () see corporate.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of individuals, created by law or under authority of law, having a continuous existence independent of the existences of its members, and powers and liabilities distinct from those of its members\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003dThe Mirror and the chapter\u003d2|url\u003dhttp://openlibrary.org/works/OL1097634W|passage\u003d\u0027That\u0027 the young Mr. Churchills liked—but they did not like him coming round of an evening and drinking weak whisky-and-water while he held forth on railway debentures and \u0027\u0027corporation\u0027\u0027 loans. Mr. Barrett, however, by fawning and flattery, seemed to be able to make not only Mrs. Churchill but everyone else do what he desired\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In Fascist Italy, a joint association of employers\u0027 and workers\u0027 representatives\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A protruding belly; a paunch\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, ‘Prelude’, \u0027Selected Stories\u0027, Oxford World\u0027s Classics paperback 2002, page 91\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"You\u0027d be surprised,\u0027 said Stanley, as though this were intensely interesting, \u0027at the number of chaps at the club who have got a \u0027\u0027corporation\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, \u0027The Book of Ebenezer Le Page\u0027, New York 2007, p. 316\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"He was a big chap with a \u0027\u0027corporation\u0027\u0027 already, and a flat face rather like Dora\u0027s, and he had a thin black moustache\", \"priority\":8}]}, \"synonyms\":{}}");

	add("corporeity", "{\"term\":\"corporeity\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027corporéité\u0027 or \u0027\u0027 from Latin \u0027corporeus\u0027 from \u0027corpus\u0027 (body)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or fact of having a physical or material body\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027: Determining what was unique about living beings, he postulated the ‘\u0027\u0027corporeity\u0027\u0027’ of a soul [...], common to beast and man alike. — Roy Porter, \u0027Flesh in the Age of Reason\u0027 (Penguin 2004, p. 56\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A body, a physical substance\", \"priority\":3}]}, \"synonyms\":{}}");

