	add("corpsepaint", "{\"term\":\"corpsepaint\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|corpse|paint|lang\u003den}}File:Carach Angren Méan 22 08 2009 4.jpg|right|thumb|150px|Trystys of the band {{w|Carach Angren}} in corpsepaint.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A style of black-and-white makeup used primarily by black metal musicians and fans, intended to make the wearer appear inhuman, corpselike, or demonic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Ronald Bogue, \u0027Deleuze\u0027s Way: Essays in Transverse Ethics and Aesthetics\u0027, Ashgate Publishing Limited (2007), ISBN 9780754660323, [http://books.google.ca/books?id\u003d7jjiWQSyT48C\u0026amp;pg\u003dPA45\u0026amp;dq\u003d%22corpsepaint%22 page 45\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Many black metal musicians dress in black robes and wear exaggerated white-and-black “\u0027\u0027corpsepaint\u0027\u0027” on their faces\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Joel McIver, \u0027Machine Head: Inside the Machine\u0027, Omnibus Press (2012), ISBN 9780857127983, [http://books.google.com/books?id\u003dDDz_AgAAQBAJ\u0026amp;pg\u003dPT250\u0026amp;dq\u003d%22corpsepaint%22 unnumbered page\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"You get kids over there in \u0027\u0027corpsepaint\u0027\u0027 going to a death metal show, but then are going to go to [a] Darkness show\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, \u0027Pop Pagans: Paganism and Popular Music\u0027 (eds. Donna Weston \u0026amp; Andy Bennett), Routledge (2014), ISBN 9781317546658, [http://books.google.com/books?id\u003d7cToBAAAQBAJ\u0026amp;pg\u003dPT92\u0026amp;dq\u003d%22corpsepaint%22 unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Far more Pagan metal bands appear in the traditional black metal \u0027\u0027corpsepaint\", \"priority\":7}]}, \"synonyms\":{}}");

