	add("corpuscularianism", "{\"term\":\"corpuscularianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The postulate that all physical bodies possess an inner and outer layer of minute particles or corpuscles.\u0026lt;ref name\u003d\u0026quot;Levere\u0026quot; \u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("corpuscularism", "{\"term\":\"corpuscularism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Ideology that discusses reality and change in terms of particles (corpuscles) and their motion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The main difference between atomism and \u0026lt;b\u0026gt;corpuscularism\u0026lt;/b\u0026gt; was the existence of the void. For Descartes, there could be no vacuum, and all matter was constantly swirling to prevent a void as corpuscles moved through other matter. Another key distinction between Descartes\u0027 corpuscularism and classical atomism is Descartes\u0027 concept of mind/body duality, which allowed for an independent realm of existence for thought, soul, and most importantly, God.\u0027\u0026lt;sup\u0026gt;[http://en.wikipedia.org/wiki/Atomis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Atomic_Renaissance]\u0026lt;/sup\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

	add("corral", "{\"term\":\"corral\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish \u0027{{l|es|corral}}\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An enclosure for livestock, especially a circular one\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We had a small \u0027\u0027corral\u0027\u0027 out back where we kept our pet llama\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An enclosure or area to concentrate a dispersed group\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Please return the shopping carts to the \u0027\u0027corral\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A circle of wagons, either for the purpose of trapping livestock, or for defense\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The wagon train formed a \u0027\u0027corral\u0027\u0027 to protect against Commanche attacks\", \"priority\":6}]}, \"synonyms\":{}}");

