	add("correctness", "{\"term\":\"correctness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|correct|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"freedom from erro\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"conformity to the truth or to fac\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"conformity to recognized standard\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The state of an algorithm that correctly mirrors its specification\", \"priority\":4}]}, \"synonyms\":{}}");

	add("correlation", "{\"term\":\"correlation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027corrélation\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A reciprocal, parallel or complementary relationship between two or more comparable object\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of the several measures of the linear statistical relationship between two random variables, indicating both the strength and direction of the relationship\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An isomorphism from a projective space to the dual of a projective space, often to the dual of itself\", \"priority\":3}]}, \"synonyms\":{}}");

