	add("correus", "{\"term\":\"correus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"First attested in the singular in 1656 and in the plural in 1707; {{l|en|ellipsis|elliptical}} use from \u0027correus debendi\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1656\u0027\u0027 June 7, w:John John Thurloe (author) and w:Thomas Thomas Birch (editor), “A letter of intelligence from the \u0027w:The Hague\u0027, 7 June 1656” in \u0027A Collection of the State Papers of John Thurloe\u0027 V (London, 1742), \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dCpYjAQAAMAAJ\u0026amp;pg\u003dPA71\u0026amp;dq\u003d%22correus%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dBFYCT56sNs7Z8QOstrGlAQ\u0026amp;ved\u003d0CGIQ6AEwB\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22correus%22\u0026amp;f\u003dfalse page 71]\u0026lt;/span\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When a creditor will accept \u0027ſolutionem particularum vel correi\u0027, the debtor or the \u0027\u0027correus\u0027\u0027 muſt pa\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1707\u0027\u0027 December 17, w:John Lauder, Lord Sir John Lauder of Fountainhall (editor), \u0027The Deciſions of the w:Court of Lords of Council and Seſſion, from June 6th, 1678, to July 30th, 1712\u0027 II (Edinburgh, 1761), \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dnuPlAAAAMAAJ\u0026amp;pg\u003dPA404\u0026amp;dq\u003d%22correi%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d0G0CT8OgH8_J8gPprfysDA\u0026amp;ved\u003d0CEMQ6AEwA\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22correi%22\u0026amp;f\u003dfalse page 404]\u0026lt;/span\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Since this act, few take bonds with cautioners, but bind them all as \u0027\u0027\u0027correi\u0027\u0027\u0027 and principals.Category:en:Law\", \"priority\":6}]}, \"synonyms\":{}}");

	add("corridor", "{\"term\":\"corridor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027corridor\u0027 from Italian \u0027corridore\u0027 (\u003d \u0027corridoio\u0027) long passage, from \u0027correre\u0027, to run.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A narrow hall or passage with rooms leading off it, for example in railway carriages (see w:Corridor (rail Wikipedia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"There is an hour or two, after the passengers have embarked, which is disquieting and fussy.Stewards, carrying cabin trunks, swarm in the \u0027\u0027corridors\u0027\u0027. Passengers wander restlessly about or hurry, with futile energy, from place to place\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A restricted tract of land that allows passage between two places\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Airspace restricted for the passage of aircraft\", \"priority\":4}]}, \"synonyms\":{}}");

