	add("corsair", "{\"term\":\"corsair\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027corsaire\u0027 from {{m|la|cursārius||pirate}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A French privateer, especially from the port of St-Mal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A privateer or pirate in genera\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1840\u0027\u0027, , http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dsurround\u0026amp;offset\u003d254475515\u0026amp;tag\u003dDickens,+Charles,+1812-1870:+Barnaby+Rudge,+1840\u0026amp;query\u003dcorsair\u0026amp;id\u003dDicBarn Chapter 34\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;If I had been born a \u0027\u0027corsair\u0027\u0027 or a pirate, a brigand, genteel highwayman or patriot -- and they\u0027re the same thing,\u0026quot; thought Mr. Tappertit, musing among the nine-pins, \u0026quot;I should have been all right. But to drag out a ignoble existence unbeknown to mankind in general -- patience! I will be famous yet.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The ship of privateers or pirates, especially of French nationalit\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A nocturnal assassin bug of the genus , found in the southern USA\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A Californian market fish (\u0027Sebastichthys rosaceus\", \"priority\":7}]}, \"synonyms\":{}}");

	add("corselet", "{\"term\":\"corselet\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027corselet\u0027 from \u0027cors\u0027 an archaic spelling of \u0027corps\u0027 (body)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Armor for the body, as, the body breastplate and backpiece taken together\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The entire suit of the day, including breastplate and backpiece, tasset and headpiece\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1786\u0027\u0027, Francis Grose, \u0027A Treatise on Ancient Armour and Weapons\u0027, page 21\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Strictly speaking, the word \u0027\u0027corcelet\u0027\u0027 meant only that part which covered the body, but was generally used to express the whole suit, under the terms of a \u0027\u0027corselet\u0027\u0027 furnished, or complete\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A tight-fitting item of clothing which covers the body and not the limbs\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A type of women\u0027s underwear, combining a bra and a girdle in one garment; a corselette\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The thorax of an insect\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, Henry James, \u0027What Maisie Knew\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"With the added suggestion of her goggles it reminded her pupil of the polished shell or \u0027\u0027corslet\u0027\u0027 of a horrid beetle\", \"priority\":9}]}, \"synonyms\":{}}");

